import React from 'react';
import ReactDOM from 'react-dom';

const ExamList = [1,2,3,4,5];

const updatedNums = ExamList.map((number)=>{
	return <li>{number}</li>;
});

ReactDOM.render(
	<ul>
		{updatedNums}
	</ul>,
	document.getElementById('root')
);
